wikitext.*:
本模板用于把最接近农历年份的公历年份转换成最接近的干支纪年、幻想乡纪年或幻想乡元素纪年。

==特别注意==
严格来说，说农历某一年等于干支纪年的某一年是错误的，因为干支纪年以立春为新年，农历以正月朔日为新年。不过基本来说从官方到民间都是把正月朔日当作干支纪年的新年了。

==参数==
*format：格式。gz为干支纪年，gsk为幻想乡纪年，elem为幻想乡元素纪年，noop为不转换。幻想乡纪年目前只支持1885至11884年的年份。
*index：年数，按照格里历，公元元年记为1，公元前二年记为-1。除非格式为noop，否则必须为整数。
*addheadtail：addheadtail非空则在转换得到的文字前后依照格式适当加上“年”、“第……季”、“之季”等。

==例子==
*<code><nowiki>{{User:Hydrofluorina/年|index=2017|format=gz}}</nowiki></code> → {{User:Hydrofluorina/年|index=2017|format=gz}}
*<code><nowiki>{{User:Hydrofluorina/年|index=2017|format=gz|addheadtail=y}}</nowiki></code> → {{User:Hydrofluorina/年|index=2017|format=gz|addheadtail=y}}
*<code><nowiki>{{User:Hydrofluorina/年|index=2017|format=gsk}}</nowiki></code> → {{User:Hydrofluorina/年|index=2017|format=gsk}}
*<code><nowiki>{{User:Hydrofluorina/年|index=2017|format=gsk|addheadtail=y}}</nowiki></code> → {{User:Hydrofluorina/年|index=2017|format=gsk|addheadtail=y}}
*<code><nowiki>{{User:Hydrofluorina/年|index=2017|format=elem}}</nowiki></code> → {{User:Hydrofluorina/年|index=2017|format=elem}}
*<code><nowiki>{{User:Hydrofluorina/年|index=2017|format=elem|addheadtail=y}}</nowiki></code> → {{User:Hydrofluorina/年|index=2017|format=elem|addheadtail=y}}
*<code><nowiki>{{User:Hydrofluorina/年|index=没有这一|format=noop|addheadtail=y}}</nowiki></code> → {{User:Hydrofluorina/年|index=没有这一|format=noop|addheadtail=y}}
